CREATE PROCEDURE `sp_Admin_validUserToEdit`(
	IN `nId` INT
)
BEGIN
	SELECT 
		1 AS `valido`
	FROM users 
	WHERE users.id = nId AND users.state = 'A' AND users.ghost = 0;
END//
