DELIMITER //
CREATE PROCEDURE `sp_getRoles`(
	IN `nIdRol` INT
)
BEGIN
	-- recibe el id de rol de quien lo llama para filtrar el catalogo
	SELECT 
		idRol, 
		slug, 
		nombre
	FROM cat_rol
	WHERE (
		case 
			when nIdRol = 1 then cat_rol.idRol != 1 AND cat_rol.idRol != 5
			when nIdRol = 5 then cat_rol.idRol > 0
			ELSE cat_rol.idRol < 1
		END);
END//
