DELIMITER //
CREATE PROCEDURE `sp_listarSolicitudes`(
	IN `tipo` INT
)
BEGIN
if tipo = 0 then
	/*SELECT 
	datosSolicitudes.*,
	files.RUTA AS rutaContestacion,
	if( copias_conocimiento_estatus.NoEnterados IS NULL, 0, copias_conocimiento_estatus.NoEnterados) AS NoEnterados , 
