CREATE PROCEDURE `sp_Solicitud_setRegistrarOficio`(
	IN `nTipo` INT,
	IN `nOficio` VARCHAR(55),
	IN `cRemitente` VARCHAR(55),
	IN `cCargo` VARCHAR(55),
	IN `cAsunto` VARCHAR(55),
