-- Volcando estructura para procedimiento admin.sp_Solicitud_setRegistrarRequi
DELIMITER //
CREATE PROCEDURE `sp_Solicitud_setRegistrarRequi`(
	IN `nTipo` INT,
	IN `nCapitulo` INT,
	IN `nFolio` VARCHAR(55),
	IN `fRecibido` DATE,
	IN `hRecibido` TIME,
