	IN `nIdAuth` INT
)
BEGIN
		tipo, 
		capitulo, 
		numFolio, 
		fechaRecibido, 
		horaRecibido, 
		fechaTermino,
		areaSolicita, 
		areaAsignar, 
		idArchivo, 
		seguimiento, 
		created_at, 
		created_by
	)
	VALUES (
		nTipo,
		nCapitulo,
		nFolio,
