SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `trigger_update_solicitud` AFTER UPDATE ON `cap_solicitud` FOR EACH ROW BEGIN
	-- NULL no se puede comparar usando los operadores '=' o '!=', se debe usar 'IS'
	IF (
			(
				 OLD.updated_at IS NULL OR 
				 OLD.updated_by IS NULL OR
				 OLD.updated_at != NEW.updated_at OR
				 OLD.updated_by != NEW.updated_by
		 	) AND NEW.motivoCambio IS NOT NULL
		) THEN
			idSolicitud,
			tipo,
			idArchivo,
			areaSolicita,
			areaAsignar,
			areaEmite,
			numOficio,
			asunto,
			cargo,
			remitente,
			numFolio,
			numMemo,
			capitulo,
			termino,
			respuesta,
			fechaRecibido,
			horaRecibido,
			fechaTermino,
			seguimiento,
			created_at,
			updated_at,
			created_by,
			updated_by,
			idStatus,
			recordatorio,
			sysNotify,
			accion,
			motivoCambio
		) VALUES (
			OLD.id,
			OLD.tipo,
			OLD.idArchivo,
			OLD.areaSolicita,
			OLD.areaAsignar,
			OLD.areaEmite,
			OLD.numOficio,
			OLD.asunto,
			OLD.cargo,
			OLD.remitente,
			OLD.numFolio,
			OLD.numMemo,
			OLD.capitulo,
			OLD.termino,
			OLD.respuesta,
			OLD.fechaRecibido,
			OLD.horaRecibido,
			OLD.fechaTermino,
			OLD.seguimiento,
			OLD.created_at,
			OLD.updated_at,
			OLD.created_by,
			OLD.updated_by,
			OLD.idStatus,
			OLD.recordatorio,
			OLD.sysNotify,		
			'UPDATE',
			NEW.motivoCambio
		);		
	END IF;
END//
DELIMITER ;
